export default function MapsIndex() {
    const { isLoaded, loadError } = useLoadScript({
        googleMapsApiKey: process.env.REACT_APP_GOOGLE_KEY,
    });

    if (loadError) return <div>Error loading maps</div>;
    if (!isLoaded) return <div>Loading...</div>

    return (
        <Map />
    )
}

function Map() {
    const center = useMemo(() => ({lat: -6.326354391261137, lng: 106.60335938569949}), []);
    const options = {
        disableDefaultUI: false,
        zoomControl: false,
    }
    const [selectedMap, setSelectedMap] = useState(null);

    useEffect(() => {
        navigator.geolocation.getCurrentPosition((position) => {
            console.log(position.coords)
        })
    }, [])

    return <>
        <GoogleMap zoom={5} center={center} options={options} mapContainerClassName="map-container">

            {
                <MarkerClusterer>
                {(clusterer) =>
                    dataList.map((row) => {
                        return <Marker key={row.lat}
                        position={{lat: row.lat, lng: row.lon}}
                        // label={row.nopol}
                        clusterer={clusterer}
                        icon={{
                            url: "/images/truck_yellow.png",
                            scaledSize: new window.google.maps.Size(45, 30),
                            origin: new window.google.maps.Point(0, 0),
                            anchor: new window.google.maps.Point(15, 15),
                        }}
                        onClick={() => setSelectedMap(row)} />;
                    })
                }
            </MarkerClusterer>
            }

            {selectedMap ? (
                <InfoWindow position={{lat: selectedMap.lat, lng: selectedMap.lon}} onCloseClick={() => setSelectedMap(null)}>
                    <>
                        <div>{selectedMap.company_nm}</div>
                        <div>{selectedMap.nopol}</div>
                        <p>{selectedMap.addr}</p>
                    </>
                </InfoWindow>
            ) : null}
        </GoogleMap>
    </>
}
